import { types } from "./actions";
const inital_state = { projects: [] };

const project = (state = inital_state, action) => {
  if (action.type == types.GET_PROJECTS) {
    const { projects } = action.payload;
    return { ...state, projects };
  } else {
    return state;
  }
};

export default project;
